(4,'제22기 정기주주총회 [소집 공고]','<p><b><span style=\"font-size: 14pt;\">제22기 정기주주총회 [소집 공고]</span></b></p><p>&nbsp;</p><p>주주님의 건승과 댁내의 평안을 기원합니다.</p><p><br></p><p>우리회사 정관 제28조에 의하여 정기주주총회를 아래와 같이 소집하오니 참석하여 주시기 바랍니다.&nbsp;</p><p>-&nbsp; 아&nbsp; &nbsp; &nbsp; &nbsp; 래&nbsp; -</p><p>&nbsp;</p><p>&nbsp; &nbsp;1.<span style=\"white-space:pre\">	</span>일&nbsp; &nbsp; 시 : 2022년 03월 31일(목) 오전 10시</p><p><br></p><p>&nbsp; &nbsp;2.<span style=\"white-space:pre\">	</span>장&nbsp; &nbsp; 소 : 서울특별시 서초구 효령로 34길 4, 프린스효령빌딩 6층&nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; (방배동, 프린스 효령빌딩) (Tel. 02-581-3883)</p><p><br></p><p>&nbsp; &nbsp;3.<span style=\"white-space:pre\">	</span>회의목적사항</p><p>&nbsp; &nbsp; &nbsp; 《보고 안건》 감사보고 / 영업보고</p><p>&nbsp; &nbsp; &nbsp; 《부의 안건》</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 제1호 의안 : 제22기 재무제표 승인의 건</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 제2호 의안 : 정관개정 승인의 건</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 제3호 의안 : 이사보수 한도액의 승인의 건</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 제4호 의안 : 감사보수 한도액의 승인의 건</p><p>&nbsp;</p><p>&nbsp; &nbsp;4. 경영참고사항 비치</p><p>&nbsp; &nbsp; &nbsp;상법 제448에 의거 경영참고사항을 우리 회사의 본점에 비치하오니 참고하시기 바랍니다.</p><p>&nbsp;</p><p>&nbsp; &nbsp;5. 실질주주의 의결권 행사에 관한 사항</p><p>&nbsp; &nbsp; &nbsp; 우리 회사의 이번 주주총회에서는 종전과 같이 주주총회에 참석하여 의결권을 직접 행사하시거나 또는 위임장에 의거 의결권을 간접 행사하실 수 있습니다.</p><p><br></p><p><br></p><p><br></p><p>2022년 03월 16일</p><p>서울특별시 서초구 효령로 34길 4, 프린스효령빌딩</p><p>주식회사 인텔리빅스 대표이사 장정훈 (직인생략)</p><div><br></div>','2022-03-16 19:39:45','김미연(info)','2022-03-16 19:39:45',130),
